const transformDataToBoxplot = (data) => {
  const eventLabels = []
  const eventTypes = []

  // Extract unique event labels and types
  Object.values(data).forEach((events) => {
    events.forEach((event) => {
      if (!eventLabels.includes(event.Type)) {
        eventLabels.push(event.Type)
      }
      if (!eventTypes.includes(event.EventType)) {
        eventTypes.push(event.EventType)
      }
    })
  })

  // Initialize results array with structure
  const results = eventLabels.map((label) => ({
    label,
    values: new Array(Object.keys(data).length).fill(0).map(() => []),
  }))

  // Fill in the values for each user
  Object.entries(data).forEach(([userId, events], index) => {
    events.forEach((event) => {
      const labelIndex = eventLabels.indexOf(event.Type)
      const startTime = new Date(event.Start)
      const endTime = new Date(event.End)
      const duration = (endTime - startTime) / 1000 // Convert milliseconds to seconds
      results[labelIndex].values[index].push(duration)
    })
  })

  return results
}

export default transformDataToBoxplot
